import "./styles.css";
import React, { Component } from "react";

export class SideNavigationMenu extends Component {
  render() {
    return (
      <div className="sideNavigationMenuContainer">
        Вкладки
        {typesData.map((item) => (
          <div className="sideNavigationMenuItemContainer" key={item.key}>
            {item.value}
          </div>
        ))}
      </div>
    );
  }
}

const typesData = [
  { key: 0, value: "Все", icon: "&#9989;" },
  { key: 1, value: "Личное", icon: "&#128102;" },
  { key: 2, value: "Работа", icon: "&#128188;" },
  { key: 3, value: "Учеба", icon: "&#9997;" },
  { key: 4, value: "Отдых", icon: "&#9749;" },
];

export default SideNavigationMenu;
